import React from 'react';
import styled from '@emotion/styled';

const StyledRow = styled.div`
    width: 27rem;
    display: flex;
    justify-content: space-between;
    padding: 1rem;
`;

const InputRow = ({ updateFields }) => {
    return(
        <StyledRow>
            <input type="text" placeholder="Paste your json or csv here" value="jasonbason"/>
            <input type="text" placeholder="Paste your json or csv here" value="jasonbason"/>
            <button
                onClick={ () => updateFields() }>Add</button>
        </StyledRow>
    );
}

export default InputRow;
